import React  from "react";
import CSELogo from "D:/csea/src/components/logo.jpeg";
function Header(){
    return(
        <div class = "head">
            <div class = "logo" >
                <img src={CSELogo} alt = "Logo for Nit Andhra Pradesh" />
            </div>
            <div class = "name"></div>
        </div>
    );
}
export default Header;
